import React, { useEffect, useState } from "react";
import { useParams, useNavigate } from "react-router-dom";
import styled from "styled-components";
import recipesData from "../data"; // Import the static dummy data
import axios from "../services/axiosInstance";

const PageContainer = styled.div`
  padding: 20px;
  max-width: 800px;
  margin: 0 auto;
`;

const RecipeImage = styled.img`
  width: 100%;
  height: 300px;
  object-fit: cover;
  border-bottom: 1px solid #ddd;
  margin-bottom: 20px;
  border-radius: 8px;
`;

const RecipeTitle = styled.h1`
  margin-bottom: 20px;
  font-size: 2rem;
  color: #333;
`;

const Ingredients = styled.div`
  margin-bottom: 20px;
`;

const Preparation = styled.div``;

const IngredientsTitle = styled.h2`
  font-size: 1.5rem;
  color: #555;
  margin-bottom: 10px;
`;

const PreparationTitle = styled.h2`
  font-size: 1.5rem;
  color: #555;
  margin-bottom: 10px;
`;

const Button = styled.button`
  background-color: #007bff;
  color: #fff;
  border: none;
  padding: 10px 20px;
  border-radius: 5px;
  cursor: pointer;
  margin-right: 10px;

  &:hover {
    background-color: #0056b3;
  }
`;

const RecipePage = () => {
  const { id } = useParams();
  const [recipe, setRecipe] = useState({
    name: "",
    image: "",
    ingredients: "",
    preparation: "",
  });

  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const navigate = useNavigate();

  useEffect(() => {
    const fetchRecipe = async () => {
      try {
        const response = await axios.get(`/recipes/${id}`);
        console.log("Recipe from database:", response.data); // Debug log
        setRecipe(response.data);
      } catch (error) {
        console.error("Database fetch error:", error); // Debug log
        const dummyRecipe = recipesData.find(
          (recipe) => recipe.id === parseInt(id)
        );
        if (dummyRecipe) {
          console.log("Recipe from dummy data:", dummyRecipe); // Debug log
          setRecipe(dummyRecipe);
        } else {
          setError("Recipe not found");
        }
      } finally {
        setLoading(false);
      }
    };

    fetchRecipe();
  }, [id]);

  const handleEdit = () => {
    navigate(`/edit-recipe/${id}`);
  };

  const handleDelete = async () => {
    try {
      await axios.delete(`/recipes/${id}`);
      navigate("/recipes"); // Redirect to the recipes list after deletion
    } catch (error) {
      console.error("Error deleting recipe:", error);
      setError("Failed to delete recipe");
    }
  };

  if (loading) {
    return <div>Loading...</div>;
  }

  if (error) {
    return <div>{error}</div>;
  }

  if (!recipe) {
    return <div>Recipe not found</div>;
  }

  return (
    <PageContainer>
      {recipe.image && (
        <RecipeImage
          src={
            recipe.image.startsWith("http") || recipe.image.startsWith("/")
              ? recipe.image
              : `/uploads/${recipe.image}`
          }
          alt={recipe.title}
        />
      )}

      <RecipeTitle>{recipe.title}</RecipeTitle>
      <Ingredients>
        <IngredientsTitle>Ingredients</IngredientsTitle>
        <p>{recipe.ingredients}</p>
      </Ingredients>
      <Preparation>
        <PreparationTitle>Preparation</PreparationTitle>
        <p>{recipe.preparation}</p>
      </Preparation>
      <div>
        <Button onClick={handleEdit}>Edit</Button>
        <Button onClick={handleDelete} style={{ backgroundColor: "#dc3545" }}>
          Delete
        </Button>
      </div>
    </PageContainer>
  );
};

export default RecipePage;
